import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import Profile from "./components/Profile";


const App = () => {
  return (

        <div class="grid">
            <Header/>
            <Profile/>
            <div className="ctegory" ></div>
            <div class="events-search">Events happening in your city</div>
            <div class="people">People</div>
            <div class="event">
                <div class="event1">event1</div>
                <div class="event2">event1</div>
            </div>
            <div class="you-event">Event sugestion</div>
            <div class="explore">Explore Events</div>
            <div class="weather">Weather</div>
        </div>


  )

}



export default App;
